const ModalOnMap = () => {

    return (
        <div className="areas-map-block__modal modal modal--hidden">
            <div className="modal__wrapper">
                <button className="modal__close">&times;</button>
                <div className="modal__title">Modal window with district info</div>
                <div className="modal__content">
                    <p>Content</p>
                </div>
            </div>
            <div className="modal__overlay"></div>
        </div>
    );
}

export default ModalOnMap;
